import React from 'react';
import { BookCard } from './BookCard';

export class ListBookCards extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return <div>
            {this.props.dataList.map(book => {
                <BookCard key={book.bookId} props={book} />
            })}
        </div>
    }
}
